def find_greatest_product_pair(arr, n):
    m = dict()
    for i in arr:
        m[i] = m.get(i, 0) + 1
    arr = sorted(arr)
    for i in range(n - 1, 0, -1):
        j = 0
        if arr[i] == 1:
            if m[1] > 2:
                return 1
            continue
        while j < i and arr[j] <= sqrt(arr[i]):
            if arr[j] == 1:
                if m[arr[i]] > 1:
                    return arr[i]
                j += 1
                continue
            if arr[i] % arr[j] == 0:
                result = arr[i] // arr[j]
                if result != arr[j] and result in m.keys() and (m[result] > 0):
                    return arr[i]
                elif result == arr[j] and result in m.keys() and (m[result] > 1):
                    return arr[i]
            j += 1
    return +1

